import React, { useEffect } from 'react'
import useAxios, { All } from '../services/axios'

const HomeScreen = () => {
    const { data, error, isLoading } = useAxios('name/eesti')||[];
    console.log(data[0]?.name.common,'loading....data...');
    useEffect(() => {

        if (isLoading) {
          return <Text>Loading...</Text>;
        }

        if (error) {
          return <Text>{error.message}</Text>;
        }
    }, [])

  return (
    <View>
      <Text>HomeScreen</Text>
      {/* <FlatList
